import React, { Component } from "react";
import Inputs from "./components/inputs.jsx";
import "./App.css";

class App extends Component {
  state = {
    inputs: [
      { id: 1, value: "Random" },
      { id: 2, value: "Random" },
      { id: 3, value: "Random" },
    ],
  };

  constructor() {
    super();
  }

  handleAdd = () => {
    const newId = this.state.inputs.length;
    this.state.inputs.push();
  };

  render() {
    return (
      <div>
        <h1 className="App-header">NEANEX QUERY BUILDER</h1>
        <main className="Main">
          <Inputs inputs={this.state.inputs} onAdd={this.handleAdd} />
        </main>
      </div>
    );
  }
}

export default App;
